package in.test.programs;

public class StarPrintProgram {

	/**
	 * To print the Below Image1.<br />
	 * <img src= "data:image/jpeg;base64,
	 * "
	 * />
	 */
	public static void starPrint1(int length) {
		for (int i = 1; i <= length; i++) {
			for (int j = 1; j <= i; j++) {
				System.out.print("*");
			}
			System.out.print("\n");
		}
	}

	/**
	 * To print the Below Image2.<br />
	 * <img src=
	 * "data:image/jpeg;base64,"
	 * />
	 */
	public static void starPrint2(int length) {
		int printLoop = 1;
		for (int i = 0; i < length; i++) {
			for (int j = 0; j < printLoop; j++) {
				System.out.print("*");
			}

			System.out.println("");
			printLoop = printLoop + 2;
		}
	}

	/**
	 * To print the Below Image3.<br />
	 * <img src=
	 * "data:image/jpeg;base64,"
	 * />
	 */
	public static void starPrint3(int length) {
		int printPos = length;
		for (int i = 0; i <= length; i++) {
			for (int j = 0; j <= length; j++) {
				if (j >= printPos) {
					System.out.print("*");
				} else
					System.out.print(" ");
			}
			System.out.println("");
			printPos--;
		}
	}

	/**
	 * TO print below image4<br/>
	 * <img src="data:image/jpeg;base64,"/>
	 *  **/
	public static void starPrint4(int length) {
		
		int printLength=9;
		int printPos=printLength-1;
				
		for (int i = 0; i < length; i++) {
			for (int j = 0; j < printLength; j++) {
				if(j>=printPos)
					System.out.print("*");
				else 
					System.out.print(" ");
			}
			printPos=printPos-2;
			System.out.println("");
		}
	}
	
	
	/**To print Pyramid Image <br/>
	 <img src="data:image/jpeg;base64,"/>  **/
	public static void starPrint5(int length) {

		int column = 2 * length;
		int startPoint = column / 2, endPoint = column / 2;
		for (int i = 1; i <= length; i++) {
			for (int j = 1; j <= column; j++) {

				if (j>=startPoint && j<=endPoint)
					System.out.print("*");
				else
					System.out.print(" ");
			}
			startPoint=startPoint-1;
			endPoint=endPoint+1;
			System.out.println("");

		}
	}

    
	/**To print below Number Image 3 <br/>
	 * <img src="data:image/jpeg;base64," /> **/
	public static void starPrint6(int length){
				
		boolean isReverseStart= false;
		int column=2*length;
		int start=column/2; int end=column/2;
		
		for (int i = 0; i < column; i++) {
			for (int j = 0; j < column; j++) {
				
				if(j>=start && j<=end)
					System.out.print("*");
				else
					System.out.print(" ");
			}
			
			if(start==1 && end==(column-1))
				isReverseStart=true;
			
			if(isReverseStart)start++;else start--;
			if(isReverseStart)end--;else end++;
			System.out.println();
		}
	}

}
